import React from 'react';
import ReactDOM from 'react-dom';
import './styles/style.css';  // Vincula o CSS
import App from './App';       // Componente principal

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
